Colouration of live animals blackish (
Fig. 9A
), paraterga and epiproct contrasting yellow-orange, head and antennae dark brownish, legs pale brownish; colouration in alcohol, after one year of preservation, blackish or faded to black-brown (

Fig. 9
B-H

), paraterga and epiproct pale whitish yellow to light yellow, legs and sterna light yellow to pale brown, antennae light yellow to dark brownish distally.

Clypeolabral and vertigial regions sparsely setose; epicranial suture distinct. Antennae rather short (
Fig. 9A, B
), reaching behind body segment 3 when stretched dorsally, with a pair of lighter, yellowish, oblong spots above antennal sockets. In width, head <collum <segment 3 <4 <<2 <5-17 (♂, ♀), body gently and gradually tapering thereafter. Collum with three transverse rows of setae: 3+3 in anterior, 2+2 in intermediate, and 3+3 in posterior row; a very faint incision laterally in posterior 1/3; caudal corner of paraterga a minute, dentiform, slightly declined knob not drawn behind rear margin.

Paraterga 2 broad, anterior edge angular, lateral edge with two small, but evident incisions in anterior 1/3; posterior edge slightly oblique (
Fig. 9B, C
). Following paraterga strongly developed (

Fig. 9
B-H

), especially well so in ♂, slightly upturned caudally, all lying below dorsum, set at ca. upper 1/3 of midbody height, subhorizontal, caudal corner almost or fully pointed, increasingly spiniform and produced behind rear tergal margin; anterior edge well-developed, slightly convex to rounded, bordered and fused to callus. Lateral edge of paraterga with two small, but evident incisions, one in anterior 1/3, the other in posterior 1/3 on following poreless segments, but only one (at front 1/4) on following pore-bearing segments. Calluses on paraterga 2-4 delimited by a sulcus only dorsally, on following paraterga both dorsally and ventrally, rather narrow, modestly enlarged in pore-bearing segments, thinner in poreless ones (

Fig. 9
B-H

). Posterior edge of paraterga clearly concave, especially well so in segments 17-19 (
Fig. 9F
). Ozopores evident, lateral, lying in an ovoid groove at ca. 1/3 in front of caudal corner. Transverse sulcus usually distinct (
Fig. 9B, C, F
), complete on metaterga 5-18, incomplete on segments 4 and 19 (♂, ♀), deep, line-shaped, nearly reaching the bases of paraterga, evidently ribbed at bottom. Stricture between pro- and metazona wide, clearly ribbed at bottom down to base of paraterga (
Fig. 9B, C, F
). Pleurosternal carinae complete crests with a sharp caudal tooth on segments 2-7 (♂) or 2-5 (♀), a front bulge and a caudal tooth until segment 10, each with a small sharp tooth caudally, thereafter tooth increasingly strongly reduced until segment 16 (♂, ♀) (
Fig. 9C, E, H
).

Epiproct (
Fig. 9 F-H
) conical, rounded dorsoventrally, with two evident apical papillae; tip subtruncate; pre-apical papillae evident, lying rather close to tip. Hypoproct roundly subtriangular, setiferous knobs at caudal edge evident and well-separated.

Sterna sparsely setose, without modifications except for two rather large, fully separated, setose sternal cones between ♂ coxae 4 (
Fig. 9I, J
). A paramedian pair of evident tubercles in front of gonopod aperture. Legs moderately long and slender; midbody ones ca. 1.1-1.2 (♂) or 0.8-0.9 (♀) times as long as body height, prefemora without modifications, ♂ tarsal brushes present until legs 11.
